parts:
{
  "name": "UBX-TIM-FCHG",
  "class_id": "0x0D",
  "message_id": "0x16",
  "description": "Oscillator frequency changed notification",
  "message_type": "periodic_polled",
  "payload_length": {
    "fixed": 32
  },
  "payload_fields": [
    {
      "byte_offset": 0,
      "data_type": "U1",
      "name": "version",
      "description": "Message version (0x00 for this version)",
      "fixed_value": 0
    },
    {
      "byte_offset": 1,
      "data_type": {
        "array_of": "U1",
        "count": 3
      },
      "name": "reserved1",
      "description": "Reserved",
      "reserved": true
    },
    {
      "byte_offset": 4,
      "data_type": "U4",
      "name": "iTOW",
      "unit": "ms",
      "description": "GPS time of week of the navigation epoch from which the sync manager obtains the GNSS specific data. Like for the NAV message, the iTOW can be used to group messages of a single sync manager run together (See the description of iTOW for details)"
    },
    {
      "byte_offset": 8,
      "data_type": "I4",
      "name": "intDeltaFreq",
      "scale": {
        "multiplier": "2^-8"
      },
      "unit": "ppb",
      "description": "Frequency increment of the internal oscillator"
    },
    {
      "byte_offset": 12,
      "data_type": "U4",
      "name": "intDeltaFreqUnc",
      "scale": {
        "multiplier": "2^-8"
      },
      "unit": "ppb",
      "description": "Uncertainty of the internal oscillator frequency increment"
    },
    {
      "byte_offset": 16,
      "data_type": "U4",
      "name": "intRaw",
      "description": "Current raw DAC setting commanded to the internal oscillator"
    },
    {
      "byte_offset": 20,
      "data_type": "I4",
      "name": "extDeltaFreq",
      "scale": {
        "multiplier": "2^-8"
      },
      "unit": "ppb",
      "description": "Frequency increment of the external oscillator"
    },
    {
      "byte_offset": 24,
      "data_type": "U4",
      "name": "extDeltaFreqUnc",
      "scale": {
        "multiplier": "2^-8"
      },
      "unit": "ppb",
      "description": "Uncertainty of the external oscillator frequency increment"
    },
    {
      "byte_offset": 28,
      "data_type": "U4",
      "name": "extRaw",
      "description": "Current raw DAC setting commanded to the external oscillator"
    }
  ]
}
